prace poglądowe na poziomie licencjackim, magisterskim. oraz inne prace(np. prace podyplomowe , zaliczeniowe itp.)


KILKULETNIE DOŚWIADCZENIE W PISANIU PRAC

stały kontakt z klientem,

Zleceniodawca może na bieżąco kontrolować etapy pracy

Pomagam w przygotowaniu prac (magisterskich, licencjackich, zaliczeniowych) z zakresu podanego niżej a także innych tekstów naukowych. Do każdej przygotowanej części materiału,
Moja pomoc obejmuje m.in.:

dobranie tematu, planu pracy (konspektu) / przygotowanie struktury;
przygotowanie rozdziałów metodologicznych;
przygotowanie rozdziałów teoretycznych;
przygotowanie zestawienia bibliograficznego;
przygotowanie rozdziałów badawczych tj. przygotowanie i opracowanie narzędzi badawczych; analiza wyników badań własnych oraz sporządzenie nowoczesnych, kolorowych wykresów, tabel itp.;
złożenie całej pracy (w tym przygotowanie automatycznego spisu treści).

Masaż wykonywany woskiem z aromatycznej świecy. 
Zawartość wosku pszczelego powoduje, że skóra po masażu jest nawilżona i
odżywiona.Ten rytuał odżywia skórę i oczyszcza umysł, pozwala zapomnieć o zmartwieniach i uspokoić gonitwę myśli. W składzie świecy do masażu, oprócz wosku pszczelego, powinny znaleźć się aromatyczne olejki, substancje nawilżające skórę (np. masło shea, aloes, olej z jojoba czy awokado) oraz witaminy. Masaż świecą wykonuje się przecież nie tylko ze względu na właściwości relaksujące, ale także po to, by odżywić skórę. 
Który zapach wybrać? 
•	lawenda - jeśli chcesz się uspokoić i wyciszyć;
•	cytrusy - jeśli potrzebujesz pobudzenia, chcesz pozbyć się złości oraz poprawić koncentrację;
•	ylang ylang - jeśli chcesz zapomnieć o stresie, podnieść ciśnienie krwi i podnieść swoją efektywność;
•	mięta - jeśli potrzebujesz się skoncentrować;
•	cynamon - jeśli czujesz się zmęczona psychicznie i potrzebujesz pobudzenia;
•	drzewo sandałowe - jeśli chcesz się uspokoić, pozbyć stresu i napięcia fizycznego oraz psychicznego;
•	róża - jeśli chcesz wzbudzić w sobie poczucie szczęścia i stymulować organizm do większej produktywności.
